import React, { useEffect } from "react";

const StateData = () => {

    const getCovidData = async() =>{
        const res = await fetch('https://api.covid19india.org/data.json');
        console.log(res.json());
    }


    useEffect(()=>{
        getCovidData();
    })

  return (

    <h1>Hello there state Data is here</h1>
  )
}

export default StateData;
